package learning.innerClassTest;public class FinalTest {    final  String a=new String("111");    String b=new String("222");    public void change(String a,String b){        a=new String("333");        b=new String("444");    }    public static void main(String[] args){        FinalTest f=new FinalTest();        System.out.println(f.a+"  "+f.b);        f.change(f.a,f.b);        System.out.println(f.a+"  "+f.b);    }}